// import React from 'react';
import './Navbar.css'
const Navbar = () =>{
    return(
        <div className="navbar-div">
            <ul className='list'>
            <li>Home</li>
            <li>About</li>
            <li>Services</li>
            </ul>
        </div>
    )
};

export default Navbar;
